import React, { useEffect, useState } from "react";
import "../../styles/insurance-list.css";
import axios from "axios";
import { useLocation } from "react-router-dom";

const InsuranceList = () => {
  const location = useLocation();
  const selectedCar = location.state?.car || {};

  const [insurance, setInsurance] = useState([]);
  const [selectedInsurance, setSelectedInsurance] = useState(null);
  const [finance, setFinance] = useState([]);
  const [selectedFinance, setSelectedFinance] = useState(null);

  const [paymentSuccessful, setPaymentSuccessful] = useState(false);
  const [selectedPaymentOption, setSelectedPaymentOption] = useState("");
  const [showPaymentPending, setShowPaymentPending] = useState(false);
  const [selectedInsuranceError, setSelectedInsuranceError] = useState(false);

  useEffect(() => {
    loadInsurance();
    loadFinance();
  }, []);

  const loadInsurance = () => {
    axios
      .get("http://localhost:6060/insurance")
      .then(function (response) {
        setInsurance(response.data);
      })
      .catch(function (error) {
        console.log(error);
      });
  };

  const handleInsuranceChange = (insuranceId) => {
    setSelectedInsurance(insuranceId);
    setSelectedInsuranceError(false);
  };

  const loadFinance = () => {
    axios
      .get("http://localhost:6060/finance")
      .then(function (response) {
        setFinance(response.data);
      })
      .catch(function (error) {
        console.log(error);
      });
  };

  const handleFinanceChange = (financeId) => {
    setSelectedFinance(financeId);
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    if (!selectedInsurance) {
      setSelectedInsuranceError(true);
      return;
    } else {
      setSelectedInsuranceError(false);
    }

    if (selectedPaymentOption === "cardPayment") {
      setPaymentSuccessful(true);
      setShowPaymentPending(false);
    } else if (selectedPaymentOption === "cashPayment") {
      setShowPaymentPending(true);
    }
  };

  return (
    <div className="container">
      <div className="abc">
        <center>
          <h1>You Have Chosen {selectedCar.brandName} {selectedCar.modelName}</h1>
        </center>
        {selectedInsuranceError && <p className="text-danger mt-3">Please select insurance.</p>}
        <div className="col-md-6">
          <table className="table table-bordered table-hover text align-center">
            {/* ... table data */}
          </table>
        </div>
        <h2 className="topic">Enter Payment Details</h2>
        <br /> <br />
        <label>
          <input
            type="radio"
            name="options"
            value="cardPayment"
            checked={selectedPaymentOption === "cardPayment"}
            onChange={() => setSelectedPaymentOption("cardPayment")}
          />
          Card Payment
        </label>
        <br />
        <label>
          <input
            type="radio"
            name="options"
            value="cashPayment"
            checked={selectedPaymentOption === "cashPayment"}
            onChange={() => setSelectedPaymentOption("cashPayment")}
          />
          Cash Payment
        </label>
        <br /><br />
        <div className="container">
          <div className="row justify-content-left">
            <div className="col-md-6">
              {selectedPaymentOption === "cashPayment" ? (
                <div>
                  <button
                    className="btn btn-primary"
                    onClick={() => {
                      setPaymentSuccessful(false);
                      setShowPaymentPending(true);
                    }}
                    disabled={!selectedInsurance}
                  >
                    Pay
                  </button>
                  {showPaymentPending && <p className="text-warning mt-3">Payment Pending</p>}
                </div>
              ) : (
                <form onSubmit={handleSubmit}>
                  <div className="mb-3">
                    <label htmlFor="cardNumber" className="form-label">Card Number:</label>
                    <input
                      type="text"
                      className="form-control"
                      id="cardNumber"
                      name="cardNumber"
                      placeholder="Enter card number"
                      maxLength="16"
                      required
                    />
                  </div>
                  <div className="mb-3">
                    <label htmlFor="cvv" className="form-label">CVV:</label>
                    <input
                      type="password"
                      className="form-control"
                      id="cvv"
                      name="cvv"
                      placeholder="Enter CVV"
                      maxLength="3"
                      required
                    />
                  </div>
                  <button type="submit" className="btn btn-primary" disabled={!selectedInsurance}>
                    Pay
                  </button>
                  {paymentSuccessful && <p className="text-success mt-3">Payment Successful</p>}
                </form>
              )}
            </div>
          </div>
        </div>
      </div>
      <div className=" final">
      </div>
    </div>
  );
};

export default InsuranceList;
